import Foundation
import UIKit
extension UIImage {
    func convertBase64StringToImage (imageBase64String:String) -> UIImage {
        let str = "data:image/png;base64,"
        let imageData = Data(base64Encoded: str)
        let image = UIImage(data: imageData!)
        return image!
    }
}
